code.value:
rfeHwReg_register32_t ponCtlRegisterValue = 0ul;
rfeHwReg_register32_t ldoPdivRegisterValue = 0ul;

RFE_ERROR_GUARD
{   
    // Power-up Sequence:
    // Tsense
    // ATB
    // ChirpPll
    // LOI
    // RX1-4
    // RXBIST 
    // PDC1+PDC2
    // PDC3-PDC4
    // TX1-TX4

    // Excluding ADC and RCOSC, since ADC can be switched ON from Off state in standbyToOn, and RCOSC used only once

    // Set GLDO1V3 to 0.9V before TX power off to standby, due to TX PA reliability requirement to do power on at 0.9V
    //rfeHwGldo_profile_t profileBackup;
    //rfeHwGldo_readTxGldoProfileFromHw( profileIndex, &profileBackup, RFE_ERROR_FUNCTION_ARGUMENT );
    // NOTE do not use rfeHwGldo_switchGldo1V3ToNewProfileAndSetNewValueInSmallSteps before it is fully debugged
    //rfeHwGldo_switchGldo1V3ToNewProfileAndSetNewValueInSmallSteps( profileIndex, rfeHwGldo_vOut_0V9_e, profileBackup.dcBg, RFE_ERROR_FUNCTION_ARGUMENT );

    // chirp pll is divided into 6 small functions so that instead of waiting for poll status flag, we can complete other IP power management.
    // CHIRPPLL step 1
    if ( rfeRole == rfe_role_follower_e )
    {
        //  Followers use Chirp PLL of leader
    }
    else
    {
#ifndef BUILD_FOR_M3SA
        rfeHwChirppll_enableBandGap( &ponCtlRegisterValue, RFE_ERROR_FUNCTION_ARGUMENT );
#endif
    }

    // Tsense 
    rfeSwPwrMngr_hwTsenseOffToOn( RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // CHIRPPLL step 2
    if ( rfeRole == rfe_role_follower_e )
    {
        //  Followers use Chirp PLL of leader
    }
    else
    {
#ifndef BUILD_FOR_M3SA            
        rfeHwChirppll_enableBiasCurrent( &ponCtlRegisterValue, RFE_ERROR_FUNCTION_ARGUMENT );
#endif
    }

    // ATB
    rfeHwAtb_offToStandby( RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // CHIRPPLL step 3
    if ( rfeRole == rfe_role_follower_e )
    {
        //  Followers use Chirp PLL of leader
    }
    else
    {
#ifndef BUILD_FOR_M3SA
        rfeHwChirppll_enableHvCpLdo( &ponCtlRegisterValue, RFE_ERROR_FUNCTION_ARGUMENT );
#endif   
    }

    // LOI
    rfeHwLoif_offToStandby( RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );


    // CHIRPPLL step 4
    if ( rfeRole == rfe_role_follower_e )
    {
        //  Followers use Chirp PLL of leader
    }
    else
    {
#ifndef BUILD_FOR_M3SA
        rfeHwChirppll_enablePdivLdo( &ponCtlRegisterValue, &ldoPdivRegisterValue, RFE_ERROR_FUNCTION_ARGUMENT );
#endif
    }

    // RX1
    rfeHwRx_offToStandby( rfe_rxIndex_1_e , RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // RX1
    rfeHwRx_offToStandby( rfe_rxIndex_2_e , RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // RX3
    rfeHwRx_offToStandby( rfe_rxIndex_3_e , RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // RX4
    rfeHwRx_offToStandby( rfe_rxIndex_4_e , RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // CHIRPPLL step 5
    if ( rfeRole == rfe_role_follower_e )
    {
        //  Followers use Chirp PLL of leader
    }
    else
    {
#ifndef BUILD_FOR_M3SA
        rfeHwChirppll_enablePfdVcoLvLdo( &ponCtlRegisterValue, RFE_ERROR_FUNCTION_ARGUMENT );
#endif
    }

    // RX Bist
    rfeHwRxbist_offToStandby( RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );           
    // TX is divided into small functions so that all TX will have common delay. For the wait time value please refer rfeHwTx_offToStandby.
    // Multi cast is not implemented due to di dt limit.
    rfe_txIndex_t index;
    rfeHwSpi_register32_t spiPonRegValArr[RFE_TX_COUNT];
    for( index = rfe_txIndex_1_e; index <= rfe_txIndex_4_e; index++)
    {
        // TX step 1
        spiPonRegValArr[index] = rfeHwTx_enableTxPonLs( index, RFE_ERROR_FUNCTION_ARGUMENT );
    }
    RFE_WAIT_USEC ( RFE_HW_TX_PON_TX_LS_WAIT_5_MICRO_SECONDS );  // wait for 5 us

    for( index = rfe_txIndex_1_e; index <= rfe_txIndex_4_e; index++)
    {
        // TX step 2
        spiPonRegValArr[index] = rfeHwTx_enableTxLdo( index, spiPonRegValArr[index], RFE_ERROR_FUNCTION_ARGUMENT );
    }

    RFE_WAIT_USEC ( RFE_HW_TX_PON_LDO_WAIT_30_MICRO_SECONDS );  // wait for 30us

    //TX step 3
    for( index = rfe_txIndex_1_e; index <= rfe_txIndex_4_e; index++)
    {
        rfeHwTx_enableTxDigDftClkFreeRun( index, spiPonRegValArr[index], RFE_ERROR_FUNCTION_ARGUMENT );
    }
    // CHIRPPLL step 6
    if ( rfeRole == rfe_role_follower_e )
    {
        //  Followers use Chirp PLL of leader
    }
    else
    {
#ifndef BUILD_FOR_M3SA
        rfeHw_profileIndex_t activeProfileIndex = rfeHwTe_getActiveProfile( RFE_ERROR_FUNCTION_ARGUMENT );
        rfeHwChirppll_disableFilteringBypassEnableLevelShifters( activeProfileIndex, &ponCtlRegisterValue, &ldoPdivRegisterValue, RFE_ERROR_FUNCTION_ARGUMENT );
        RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
#endif
    }
}

#ifdef RFE_HW_ENABLE_RANGE_CHECK
    RFE_ERROR_GUARD
    {
        //Tx input parameter range check
        if ( ( txSelect < RFE_TX_SELECT_NONE ) || ( txSelect > RFE_TX_SELECT_ALL ) )
        {
            RFE_ERROR_SET( rfe_error_parameterOutOfRange_e );
        }
        else
        {
            /* No code needed here */
        }

        //Rx input parameter range check
        if ( ( rxSelect < RFE_RX_SELECT_NONE ) || ( rxSelect > RFE_RX_SELECT_ALL ) )
        {
            RFE_ERROR_SET( rfe_error_parameterOutOfRange_e );
        }
        else
        {
            /* No code needed here */
        }
    }
#endif


    RFE_ERROR_GUARD
    {
        // Activation Sequence:
        // ATB
        // ChirpPll
        // LOI
        // RX1-4
        // RXBIST 
        // ADC1-4
        // PDC1+PDC2
        // PDC3-PDC4
        // TX1-TX4

        // ATB
        // TODO ERROR 79 on MESA: rfe_error_atbBandGapNotStarted_e
        // TODO CHECK ON SILICON => works on silicon
#ifndef BUILD_FOR_M3SA
        rfeHwAtb_standbyToOn( RFE_ERROR_FUNCTION_ARGUMENT );
#endif
        RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

        // ChirpPLL
        // chirppll_on2stby()
        if ( rfeRole == rfe_role_follower_e )
        {
            //  Followers use Chirp PLL of leader
        }
        else
        {
#ifndef BUILD_FOR_M3SA
            rfeHwChirppll_standbyToPllLockedCwMode(RFE_ERROR_FUNCTION_ARGUMENT);
#endif
            RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }

        // LOIF
        rfeHwLoif_standbyToOn( RFE_ERROR_FUNCTION_ARGUMENT );
        RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );


        // RX is divided into small functions so that all selected RX will have common delay.
        // 4x RX IPs step 1
        //TODO:STRX-8402 Merge issue with 0.8.12
        rfeHwSpi_register32_t spiPwrCtlRegValue[RFE_RX_COUNT];
        if ( SELECT_IP( rxSelect, SELECT_IP1 ) )
        {
          // RX1
          spiPwrCtlRegValue[rfe_rxIndex_1_e] = rfeHwRx_enablePowerControl( rfe_rxIndex_1_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP2 ) )
        {
          // RX2
          spiPwrCtlRegValue[rfe_rxIndex_2_e] = rfeHwRx_enablePowerControl( rfe_rxIndex_2_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP3 ) )
        {
          // RX3
          spiPwrCtlRegValue[rfe_rxIndex_3_e] = rfeHwRx_enablePowerControl( rfe_rxIndex_3_e, RFE_ERROR_FUNCTION_ARGUMENT );        
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP4 ) )
        {
          // RX4
          spiPwrCtlRegValue[rfe_rxIndex_4_e] = rfeHwRx_enablePowerControl( rfe_rxIndex_4_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        //For wait time, please check rfeHwRx_standbyToOn
        RFE_WAIT_USEC ( 5ul )

        // 4x RX IPs step 2
        if ( SELECT_IP( rxSelect, SELECT_IP1 ) )
        {
          // RX1
          rfeHwRx_disableFastSwitchEnableTePowerOn( rfe_rxIndex_1_e, spiPwrCtlRegValue[rfe_rxIndex_1_e], RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP2 ) )
        {
          // RX2
          rfeHwRx_disableFastSwitchEnableTePowerOn( rfe_rxIndex_2_e, spiPwrCtlRegValue[rfe_rxIndex_2_e], RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP3 ) )
        {
          // RX3
          rfeHwRx_disableFastSwitchEnableTePowerOn( rfe_rxIndex_3_e, spiPwrCtlRegValue[rfe_rxIndex_3_e], RFE_ERROR_FUNCTION_ARGUMENT );        
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP4 ) )
        {
          // RX4
          rfeHwRx_disableFastSwitchEnableTePowerOn( rfe_rxIndex_4_e, spiPwrCtlRegValue[rfe_rxIndex_4_e], RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        // RXBIST
        // TO DO: We need these modes in RXBIST PHASE => Define new global power states !
        // idaSTRX_rxbist_stby2on()
        //rfeHwRxbist_standbyToOnRfMode( RFE_ERROR_FUNCTION_ARGUMENT );
        //rfeHwRxbist_standbyToOnBbMode( RFE_ERROR_FUNCTION_ARGUMENT );
        //RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

        // RX is divided into small functions so that all selected RX will have common delay.
        // 4x RX ADC IPs
        // ADC are on only if the corespodding RX is on
        if ( SELECT_IP( rxSelect, SELECT_IP1 ) )
        {
          // RX1 ADC
          rfeHwRxAdc_enablePonLsIref( rfeHwRxAdc_adcIndex_1_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP2 ) )
        {
          // RX2 ADC
          rfeHwRxAdc_enablePonLsIref( rfeHwRxAdc_adcIndex_2_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP3 ) )
        {
          // RX3 ADC
          rfeHwRxAdc_enablePonLsIref( rfeHwRxAdc_adcIndex_3_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP4 ) )
        {
          // RX4 ADC
          rfeHwRxAdc_enablePonLsIref( rfeHwRxAdc_adcIndex_4_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        //For wait time, please check rfeHwRxAdc_offToOn
        RFE_WAIT_USEC ( 5ul )

        if ( SELECT_IP( rxSelect, SELECT_IP1 ) )
        {
          // RX1 ADC
          rfeHwRxAdc_enableClkLdo( rfeHwRxAdc_adcIndex_1_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP2 ) )
        {
          // RX2 ADC
          rfeHwRxAdc_enableClkLdo( rfeHwRxAdc_adcIndex_2_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP3 ) )
        {
          // RX3 ADC
          rfeHwRxAdc_enableClkLdo( rfeHwRxAdc_adcIndex_3_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP4 ) )
        {
          // RX4 ADC
          rfeHwRxAdc_enableClkLdo( rfeHwRxAdc_adcIndex_4_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        //For wait time, please check rfeHwRxAdc_offToOn
        RFE_WAIT_USEC ( 5ul )

        if ( SELECT_IP( rxSelect, SELECT_IP1 ) )
        {
          // RX1 ADC
          rfeHwRxAdc_enableSerLdoQLdo( rfeHwRxAdc_adcIndex_1_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP2 ) )
        {
          // RX2 ADC
          rfeHwRxAdc_enableSerLdoQLdo( rfeHwRxAdc_adcIndex_2_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP3 ) )
        {
          // RX3 ADC
          rfeHwRxAdc_enableSerLdoQLdo( rfeHwRxAdc_adcIndex_3_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP4 ) )
        {
          // RX4 ADC
          rfeHwRxAdc_enableSerLdoQLdo( rfeHwRxAdc_adcIndex_4_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        //For wait time, please check rfeHwRxAdc_offToOn
        RFE_WAIT_USEC ( 5ul )

        if ( SELECT_IP( rxSelect, SELECT_IP1 ) )
        {
          // RX1 ADC
          rfeHwRxAdc_enableDmuxDivLfDacShLdo( rfeHwRxAdc_adcIndex_1_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP2 ) )
        {
          // RX2 ADC
          rfeHwRxAdc_enableDmuxDivLfDacShLdo( rfeHwRxAdc_adcIndex_2_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP3 ) )
        {
          // RX3 ADC
          rfeHwRxAdc_enableDmuxDivLfDacShLdo( rfeHwRxAdc_adcIndex_3_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP4 ) )
        {
          // RX4 ADC
          rfeHwRxAdc_enableDmuxDivLfDacShLdo( rfeHwRxAdc_adcIndex_4_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        //For wait time, please check rfeHwRxAdc_offToOn
        RFE_WAIT_USEC ( 5ul )

        if ( SELECT_IP( rxSelect, SELECT_IP1 ) )
        {
          // RX1 ADC
          rfeHwRxAdc_configDitherGenDetClkCtl( rfeHwRxAdc_adcIndex_1_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP2 ) )
        {
          // RX2 ADC
          rfeHwRxAdc_configDitherGenDetClkCtl( rfeHwRxAdc_adcIndex_2_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP3 ) )
        {
          // RX3 ADC
          rfeHwRxAdc_configDitherGenDetClkCtl( rfeHwRxAdc_adcIndex_3_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP4 ) )
        {
          // RX4 ADC
          rfeHwRxAdc_configDitherGenDetClkCtl( rfeHwRxAdc_adcIndex_4_e, RFE_ERROR_FUNCTION_ARGUMENT );
          RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
        }
        else
        {
        	// no code needed
        }

        // SYNC all ADCs
        // rxadc1234_sync()
        rfeHwRxAdc_synchronizeDmux( RFE_ERROR_FUNCTION_ARGUMENT );
        RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

        // 4x TX IPs
        if ( SELECT_IP( txSelect, SELECT_IP1 ) )
        {
            // TX1
            rfeHwTx_standbyToOn( rfe_txIndex_1_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( txSelect, SELECT_IP2 ) )
        {
            // TX2
            rfeHwTx_standbyToOn( rfe_txIndex_2_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( txSelect, SELECT_IP3 ) )
        {
            // TX3
            rfeHwTx_standbyToOn( rfe_txIndex_3_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( txSelect, SELECT_IP4 ) )
        {
            // TX4
            rfeHwTx_standbyToOn( rfe_txIndex_4_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }
        rfeHwSpi_transactionErrorEnable( true ); // enable SPI transaction for normal operation 
        // How about TX clocks managed by TE, part of STBY2ON BF?
    }

#ifdef RFE_HW_ENABLE_RANGE_CHECK
    RFE_ERROR_GUARD
    {
        //Tx input parameter range check
        if ( ( txSelect < RFE_TX_SELECT_NONE ) || ( txSelect > RFE_TX_SELECT_ALL ) )
        {
            RFE_ERROR_SET( rfe_error_parameterOutOfRange_e );
        }
        else
        {
            /* No code needed here */
        }

        //Rx input parameter range check
        if ( ( rxSelect < RFE_RX_SELECT_NONE ) || ( rxSelect > RFE_RX_SELECT_ALL ) )
        {
            RFE_ERROR_SET( rfe_error_parameterOutOfRange_e );
        }
        else
        {
            /* No code needed here */
        }
    }
#endif

    RFE_ERROR_GUARD
    {
        // DeActivation Sequence in reverse to below
        // ATB
        // ChirpPll
        // LOI
        // RX1-4
        // RXBIST 
        // ADC1-4
        // PDC1+PDC2
        // PDC3-PDC4
        // TX1-TX4

        // How about TX clocks managed by TE, part of ON2STBY BF?
        rfeHwSpi_transactionErrorEnable( false ); // disable SPI transaction for normal operation 
        // 4x Tx IPs
        if ( SELECT_IP( txSelect, SELECT_IP1 ) )
        {
            // TX1
            rfeHwTx_onToStandby( rfe_txIndex_1_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( txSelect, SELECT_IP2 ) )
        {
            // TX2
            rfeHwTx_onToStandby( rfe_txIndex_2_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( txSelect, SELECT_IP3 ) )
        {

            // TX3
            rfeHwTx_onToStandby( rfe_txIndex_3_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( txSelect, SELECT_IP4 ) )
        {
            // TX4
            rfeHwTx_onToStandby( rfe_txIndex_4_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        // 4x RX ADC IPs
        // ADCs have only OFF and ON state
        // ADC are on only if the corespodding RX is on
        if ( SELECT_IP( rxSelect, SELECT_IP1 ) )
        {
          // RX1 ADC
          rfeHwRxAdc_onToStandby( rfeHwRxAdc_adcIndex_1_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP2 ) )
        {
          // RX2 ADC
          rfeHwRxAdc_onToStandby( rfeHwRxAdc_adcIndex_2_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP3 ) )
        {
          // RX3 ADC
          rfeHwRxAdc_onToStandby( rfeHwRxAdc_adcIndex_3_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP4 ) )
        {
          // RX4 ADC
          rfeHwRxAdc_onToStandby( rfeHwRxAdc_adcIndex_4_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }


        // RXBIST
        rfeHwRxbist_onToStandby( RFE_ERROR_FUNCTION_ARGUMENT );

        //4x RX IPs
        if ( SELECT_IP( rxSelect, SELECT_IP1 ) )
        {
          // RX1
          rfeHwRx_onToStandby( rfe_rxIndex_1_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP2 ) )
        {
          // RX2
          rfeHwRx_onToStandby( rfe_rxIndex_2_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP3 ) )
        {
          // RX3
          rfeHwRx_onToStandby( rfe_rxIndex_3_e, RFE_ERROR_FUNCTION_ARGUMENT );  
        }
        else
        {
        	// no code needed
        }

        if ( SELECT_IP( rxSelect, SELECT_IP4 ) )
        {
          // RX4
          rfeHwRx_onToStandby( rfe_rxIndex_4_e, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
        	// no code needed
        }

        // LOIF
        rfeHwLoif_onToStandby( RFE_ERROR_FUNCTION_ARGUMENT );

        // ChirpPLL
        // chirppll_on2stby()
        if ( rfeRole == rfe_role_follower_e )
        {
            //  Followers use Chirp PLL of leader
        }
        else
        {
            rfeHwChirppll_onToStandby( RFE_ERROR_FUNCTION_ARGUMENT );
        }

        // ATB
        rfeHwAtb_onToStandby( RFE_ERROR_FUNCTION_ARGUMENT );
    }

RFE_ERROR_GUARD
{
    // Power-down Sequence in reverse to below
    // ATB
    // ChirpPll
    // LOI
    // RX1-4
    // RXBIST 
    // ADC1-4
    // PDC1+PDC2
    // PDC3-PDC4
    // TX1-TX4

    // Excluding RCOSC as RCOSC used only once

    // TX1-4
    rfeHwTx_standbyToOff( RFE_TX_SELECT_ALL, RFE_ERROR_FUNCTION_ARGUMENT );

    //RX ADC
    rfeHwRxAdc_standbyToOff( rfeHwRxAdc_adcIndex_mc_e, RFE_ERROR_FUNCTION_ARGUMENT );

    // RX Bist
    rfeHwRxbist_standbyToOff( RFE_ERROR_FUNCTION_ARGUMENT );

    // RX1-4
    rfeHwRx_standbyToOff( RFE_RX_SELECT_ALL, RFE_ERROR_FUNCTION_ARGUMENT );

    // LOI
    rfeHwLoif_standbyToOff( RFE_ERROR_FUNCTION_ARGUMENT );

    // CHIRPPLL
    if ( rfeRole == rfe_role_follower_e )
    {
        //  Followers use Chirp PLL of leader
    }
    else
    {
        rfeHwChirppll_standbyToOff( RFE_ERROR_FUNCTION_ARGUMENT );
    }

    // ATB
    rfeHwAtb_standbyToOff( RFE_ERROR_FUNCTION_ARGUMENT );

    //TSense
    rfeSwPwrMngr_hwTsenseOnToOff( RFE_ERROR_FUNCTION_ARGUMENT );
}

RFE_ERROR_GUARD
{
    // Power-down Sequence
    // TSense TX12, TX34, XO and RX
    rfeHwTsense_onToStandby( RFE_TEMP_SELECT_ALL, RFE_ERROR_FUNCTION_ARGUMENT );

    // TSense TX12, TX34, XO and RX
    rfeHwTsense_standbyToOff( RFE_TEMP_SELECT_ALL, RFE_ERROR_FUNCTION_ARGUMENT );
}

RFE_ERROR_GUARD
{   
    // Power-up Sequence:
    // Tsense TX12
    rfeHwTsense_offToStandby( rfe_temperatureSensorIndex_tx12_e, RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // Tsense TX34
    rfeHwTsense_offToStandby( rfe_temperatureSensorIndex_tx34_e, RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // Tsense XO
    rfeHwTsense_offToStandby( rfe_temperatureSensorIndex_xo_e, RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // Tsense RX
    rfeHwTsense_offToStandby( rfe_temperatureSensorIndex_rx_e, RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // Tsense is in On state in global Standby and On state

    // Tsense TX12
    rfeHwTsense_standbyToOn( rfe_temperatureSensorIndex_tx12_e, RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // Tsense TX34
    rfeHwTsense_standbyToOn( rfe_temperatureSensorIndex_tx34_e, RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // Tsense XO
    rfeHwTsense_standbyToOn( rfe_temperatureSensorIndex_xo_e, RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );

    // Tsense RX
    rfeHwTsense_standbyToOn( rfe_temperatureSensorIndex_rx_e, RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
}

RFE_ERROR_GUARD
{
    rfeHwLldoPdc_offToOn( RFE_ERROR_FUNCTION_ARGUMENT );
    RFE_WAIT_USEC( RFE_SW_PWR_MNGR_STAGGER_STEP );
    //Need to restore RxAdc init registers as we call PDC IP Reset in PDC power ON
    //RX ADC init registers
    rfeHwRxAdc_initRegisters( rfeHwRxAdc_adcIndex_mc_e, RFE_ERROR_FUNCTION_ARGUMENT );
    rfeSwCfgMngr_reconfigurePdc(RFE_ERROR_FUNCTION_ARGUMENT);
    //Need to restore Rx ADC inital calibration
    rfeSwCalibration_startupCalibrateRcOscAndAdc(true, RFE_ERROR_FUNCTION_ARGUMENT );
}
